import React, { useState } from 'react'
import { Link } from 'react-router-dom'
import styles from './Register.module.css'
import registerService from './registerService'

function Register() {

	const [inputs, setInputs] = useState({
		name: '',
		lastname: '',
		email: '',
		password: '',
	})

	const [repeatPassword, setRepeatPassword] = useState('');
	const [errorMessage, setErrorMessage] = useState(null);

	const handleSubmit = (e) => {
		e.preventDefault();

		if(inputs.password !== repeatPassword) {
			setErrorMessage({ repeatPassword: true })
			return;
		}

		try {
			const result = registerService.register(inputs);

		} catch (error) {
			console.error("There was an error: " + error);
		}

	}

	return (
		<div className={styles.reg_container}>
			<p>Registrarse</p>
			<div className={styles.link}>
				<p>¿Ya tenés una cuenta?</p>
				<Link to="/">Ingresa aquí</Link>
			</div>
			<form className={styles.form} onSubmit={handleSubmit} action="http://localhost:1234/register" method='POST'>
				<input className="form-control rounded-5" onChange={(e) => setInputs({ name: e.target.value})} type="text" placeholder="name" value={inputs.name}></input>
				<input className="form-control rounded-5" onChange={(e) => setInputs({ lastname: e.target.value})} type="text" placeholder="lastname" value={inputs.lastname}></input>
				<input className="form-control rounded-5" onChange={(e) => setInputs({ email: e.target.value})} type="email" placeholder="email" value={inputs.email}></input>
				<input className="form-control rounded-5" onChange={(e) => setInputs({ password: e.target.value})} type="password" placeholder="password" value={inputs.password}></input>
				<input className="form-control rounded-5" onChange={(e) => setRepeatPassword(e.target.value)} type="password" placeholder="repeat password" value={inputs.repeatPassword}></input>
				<div className="d-grid gap-2">
					<button className="btn btn-primary rounded-5" type="submit">Registrarse</button>
				</div>
			</form>
		</div>
	);
}

export default Register;
